What you really want to be able to do is somehow monitor a bunch of sockets at once and then handle the ones that have data ready. This way you don‚Äôt have to continously poll all those sockets to see which are ready to read. So how can you avoid polling? Not slightly ironically, you can avoid polling by using the poll() system call. In a nutshell, we‚Äôre going to ask the operating system to do all the dirty work for us, and just let us know when some data is ready to read on which sockets. In the meantime, our process can go to sleep, saving system resources. The general gameplan is to keep an array of struct pollfds with information about which socket descriptors we want to monitor, and what kind of events we want to monitor for. The OS will block on the poll() call until one of those events occurs (e.g. ‚Äúsocket ready to read!‚Äù) or until a user-specified timeout occurs. Usefully, a listen()ing socket will return ‚Äúready to read‚Äù when a new incoming connection is ready to be accept()ed. That‚Äôs enough banter. How do we use this? #include <poll.h> int poll(struct pollfd fds[], nfds_t nfds, int timeout); fds is our array of information (which sockets to monitor for what), nfds is the count of elements in the array, and timeout is a timeout in milliseconds. It returns the number of elements in the array that have had an event occur. Let‚Äôs have a look at that struct: struct pollfd { int fd; // the socket descriptor short events; // bitmap of events we're interested in short revents; // when poll() returns, bitmap of events that occurred
}; So we‚Äôre going to have an array of those, and we‚Äôll see the fd field for each element to a socket descriptor we‚Äôre interested in monitoring. And then we‚Äôll set the events field to indicate the type of events we‚Äôre interested in. The events field is the bitwise-OR of the following: Macro Description POLLIN Alert me when data is ready to recv() on this socket. POLLOUT Alert me when I can send() data to this socket without blocking. Once you have your array of struct pollfds in order, then you can pass it to poll(), also passing the size of the array, as well as a timeout value in milliseconds. (You can specify a negative timeout to wait forever.) After poll() returns, you can check the revents field to see if POLLIN or POLLOUT is set, indicating that event occurred. (There‚Äôs actually more that you can do with the poll() call. See the poll() man page, below, for more details.) Here‚Äôs an example28 where we‚Äôll wait 2.5 seconds for data to be ready to read from standard input, i.e. when you hit RETURN: #include <stdio.h>
#include <poll.h> int main(void)
{ struct pollfd pfds[1]; // More if you want to monitor more pfds[0].fd = 0; // Standard input pfds[0].events = POLLIN; // Tell me when ready to read // If you needed to monitor other things, as well: //pfds[1].fd = some_socket; // Some socket descriptor //pfds[1].events = POLLIN; // Tell me when ready to read printf("Hit RETURN or wait 2.5 seconds for timeout\n"); int num_events = poll(pfds, 1, 2500); // 2.5 second timeout if (num_events == 0) { printf("Poll timed out!\n"); } else { int pollin_happened = pfds[0].revents & POLLIN; if (pollin_happened) { printf("File descriptor %d is ready to read\n", pfds[0].fd); } else { printf("Unexpected event occurred: %d\n", pfds[0].revents); } } return 0;
} Notice again that poll() returns the number of elements in the pfds array for which events have occurred. It doesn‚Äôt tell you which elements in the array (you still have to scan for that), but it does tell you how many entries have a non-zero revents field (so you can stop scanning after you find that many). How can we put it all together into a chat server that you can telnet/nc to? What we‚Äôll do is start a listener socket, and add it to the set of file descriptors to poll(). (It will show ready-to-read when there‚Äôs an incoming connection.) Then we‚Äôll add new connections to our struct pollfd array. And we‚Äôll grow it dynamically if we run out of space. When a connection is closed, we‚Äôll remove it from the array. And when a connection is ready-to-read, we‚Äôll read the data from it and send that data to all the other connections so they can see what the other users typed. So give this poll server a try. Run it in one window, then telnet localhost 9034 from a number of other terminal windows. You should be able to see what you type in one window in the other ones (after you hit RETURN). Not only that, but if you hit CTRL-] and type quit to exit telnet, the server should detect the disconnection and remove you from the array of file descriptors. /*
** pollserver.c -- a cheezy multiperson chat server
*/ #include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <unistd.h>
#include <sys/types.h>
#include <sys/socket.h>
#include <netinet/in.h>
#include <arpa/inet.h>
#include <netdb.h>
#include <poll.h> #define PORT "9034" // Port we're listening on // Get sockaddr, IPv4 or IPv6:
void *get_in_addr(struct sockaddr *sa)
{ if (sa->sa_family == AF_INET) { return &(((struct sockaddr_in*)sa)->sin_addr); } return &(((struct sockaddr_in6*)sa)->sin6_addr);
} // Return a listening socket
int get_listener_socket(void)
{ int listener; // Listening socket descriptor int yes=1; // For setsockopt() SO_REUSEADDR, below int rv; struct addrinfo hints, *ai, *p; // Get us a socket and bind it memset(&hints, 0, sizeof hints); hints.ai_family = AF_UNSPEC; hints.ai_socktype = SOCK_STREAM; hints.ai_flags = AI_PASSIVE; if ((rv = getaddrinfo(NULL, PORT, &hints, &ai)) != 0) { fprintf(stderr, "selectserver: %s\n", gai_strerror(rv)); exit(1); } for(p = ai; p != NULL; p = p->ai_next) { listener = socket(p->ai_family, p->ai_socktype, p->ai_protocol); if (listener < 0) { continue; } // Lose the pesky "address already in use" error message setsockopt(listener, SOL_SOCKET, SO_REUSEADDR, &yes, sizeof(int)); if (bind(listener, p->ai_addr, p->ai_addrlen) < 0) { close(listener); continue; } break; } freeaddrinfo(ai); // All done with this // If we got here, it means we didn't get bound if (p == NULL) { return -1; } // Listen if (listen(listener, 10) == -1) { return -1; } return listener;
} // Add a new file descriptor to the set
void add_to_pfds(struct pollfd *pfds[], int newfd, int *fd_count, int *fd_size)
{ // If we don't have room, add more space in the pfds array if (*fd_count == *fd_size) { *fd_size *= 2; // Double it *pfds = realloc(*pfds, sizeof(**pfds) * (*fd_size)); } (*pfds)[*fd_count].fd = newfd; (*pfds)[*fd_count].events = POLLIN; // Check ready-to-read (*fd_count)++;
} // Remove an index from the set
void del_from_pfds(struct pollfd pfds[], int i, int *fd_count)
{ // Copy the one from the end over this one pfds[i] = pfds[*fd_count-1]; (*fd_count)--;
} // Main
int main(void)
{ int listener; // Listening socket descriptor int newfd; // Newly accept()ed socket descriptor struct sockaddr_storage remoteaddr; // Client address socklen_t addrlen; char buf[256]; // Buffer for client data char remoteIP[INET6_ADDRSTRLEN]; // Start off with room for 5 connections // (We'll realloc as necessary) int fd_count = 0; int fd_size = 5; struct pollfd *pfds = malloc(sizeof *pfds * fd_size); // Set up and get a listening socket listener = get_listener_socket(); if (listener == -1) { fprintf(stderr, "error getting listening socket\n"); exit(1); } // Add the listener to set pfds[0].fd = listener; pfds[0].events = POLLIN; // Report ready to read on incoming connection fd_count = 1; // For the listener // Main loop for(;;) { int poll_count = poll(pfds, fd_count, -1); if (poll_count == -1) { perror("poll"); exit(1); } // Run through the existing connections looking for data to read for(int i = 0; i < fd_count; i++) { // Check if someone's ready to read if (pfds[i].revents & POLLIN) { // We got one!! if (pfds[i].fd == listener) { // If listener is ready to read, handle new connection addrlen = sizeof remoteaddr; newfd = accept(listener, (struct sockaddr *)&remoteaddr, &addrlen); if (newfd == -1) { perror("accept"); } else { add_to_pfds(&pfds, newfd, &fd_count, &fd_size); printf("pollserver: new connection from %s on " "socket %d\n", inet_ntop(remoteaddr.ss_family, get_in_addr((struct sockaddr*)&remoteaddr), remoteIP, INET6_ADDRSTRLEN), newfd); } } else { // If not the listener, we're just a regular client int nbytes = recv(pfds[i].fd, buf, sizeof buf, 0); int sender_fd = pfds[i].fd; if (nbytes <= 0) { // Got error or connection closed by client if (nbytes == 0) { // Connection closed printf("pollserver: socket %d hung up\n", sender_fd); } else { perror("recv"); } close(pfds[i].fd); // Bye! del_from_pfds(pfds, i, &fd_count); } else { // We got some good data from a client for(int j = 0; j < fd_count; j++) { // Send to everyone! int dest_fd = pfds[j].fd; // Except the listener and ourselves if (dest_fd != listener && dest_fd != sender_fd) { if (send(dest_fd, buf, nbytes, 0) == -1) { perror("send"); } } } } } // END handle data from client } // END got ready-to-read from poll() } // END looping through file descriptors } // END for(;;)--and you thought it would never end! return 0;
} An interesting task to is to swich poll above to epoll on Linux or kqueue on Mac. For now, a similar server implement in Rust could be like: use std::collections::HashMap;
