The binary heap is a data structure that can efficiently support the basic priority-queue operations. A binary tree is heap-ordered if the key in each node is larger than or equal to the keys in that node's two children (if any). Height of complete tree with N nodes is lg N Array representation, with indices start at 1, largest key at the root Take nodes in level order No explicit links needed! Largest key is a[1], which is root of binary tree Can use array indices to move through tree Parent of node at k is at k/2 Children of node at k are at 2k and 2k+1 image image image image image Here is the code summary: public class MaxPQ<Key extends Comparable<Key>>
{ private Key[] pq; private int N; public MaxPQ(int capacity) { pq = (Key[]) new Comparable[capacity+1]; } public boolean isEmpty() { return N == 0; } private boolean less(int i, int j) { return pq[i].compareTo(pq[j]) < 0; } private void exch(int i, int j) { Key t = pq[i]; pq[i] = pq[j]; pq[j] = t; } // promotion private void swim(int k) { while (k > 1 && less(k/2, k)) { exch(k, k/2); k = k/2; } } // insert public void insert(Key x) { pq[++N] = x; swim(N); } // demotion private void sink(int k) { while (2*k <= N) { int j = 2*k; if (j < N && less(j, j+1)) j++; if (!less(k, j)) break; exch(k, j); k = j; } } // delete max public Key delMax() { Key max = pq[1]; exch(1, N--); sink(1); pq[N+1] = null; // prevent loitering return max; }
